    name STRING,
    genre STRING
);

CREATE TABLE discography (
    id UUID PRIMARY KEY,
    musician_id UUID REFERENCES musicians(id),
    album_title STRING,
    release_year INT
);

CREATE TABLE musicians (
    musician_id INT PRIMARY KEY,
    musician_name VARCHAR(255) NOT NULL
);

CREATE TABLE discography (
    discography_id INT PRIMARY KEY,
    musician_id INT,
    album_name VARCHAR(255) NOT NULL,
    release_year INT
);

CREATE TABLE genres (
    genre_id INT PRIMARY KEY,
    genre_name VARCHAR(255) NOT NULL
);

CREATE TABLE artists (
    artist_id INT PRIMARY KEY,
    artist_name VARCHAR(255) NOT NULL,
    genre VARCHAR(50)
);

CREATE TABLE albums (
    album_id INT PRIMARY KEY,
    artist_id INT REFERENCES artists(artist_id),
    album_name VARCHAR(255) NOT NULL,
    release_year INT
);

CREATE TABLE songs (
    song_id INT PRIMARY KEY,
    album_id INT REFERENCES albums(album_id),
    song_name VARCHAR(255) NOT NULL,
    song_length INT
);

CREATE TABLE artists_info (
    artist_id INT REFERENCES artists(artist_id),
    bio TEXT
);

CREATE TABLE musicians(
    musician_id UUID PRIMARY KEY,
    name VARCHAR(50) NOT NULL,
    genre VARCHAR(50) NOT NULL
);

CREATE TABLE albums(
    album_id UUID PRIMARY KEY,
    album_name VARCHAR(100) NOT NULL,
    release_date DATE NOT NULL,
    musician_id UUID REFERENCES musicians(musician_id) ON DELETE CASCADE
);

CREATE TABLE songs(
    song_id UUID PRIMARY KEY,
    song_name VARCHAR(100) NOT NULL,
    duration TIME NOT NULL,
    album_id UUID REFERENCES albums(album_id) ON DELETE CASCADE
);

CREATE TABLE tracks(
    track_id UUID PRIMARY KEY,
    track_number INT NOT NULL,
    song_id UUID REFERENCES songs(song_id) ON DELETE CASCADE
);

CREATE TABLE collaborations(
    collaboration_id UUID PRIMARY KEY,
    musician_id UUID REFERENCES musicians(musician_id) ON DELETE CASCADE,
    song_id UUID REFERENCES songs(song_id) ON DELETE CASCADE
);
